css:
ul.tab-bar > li.tab.of-highlight,
ul.tab-bar > li.tab.of-highlight:before,
ul.tab-bar > li.tab.of-highlight:after {
  background-color: rgba(126, 127, 129, 0.08);
}
.file-list .of-highlight.directory:before,
.file-list .of-highlight.file:before {
  content: '';
  background-color: rgba(126, 127, 129, 0.08);
  position: absolute;
  left: 0;
  right: 0;
  height: 25px;
}
.file-list.opened-files .save {
  z-index: 2;
  position: absolute;
  top: 3px;
  right: 0;
}
.file-list.opened-files {
  padding-left: 6px;
  width: 100%;
  background-color: #e5e5e6;
  border-bottom: 1px solid rgba(56, 58, 66, 0.2);
  border-right: 1px solid rgba(56, 58, 66, 0.2);
}
.file-list.opened-files > ol.list-tree {
  font-size: 11px;
  overflow: auto;
  height: 100%;
}
.file-list.opened-files > ol.list-tree span.icon {
  display: inline-block;
}
.file-list.opened-files > ol.list-tree span.path {
  font-size: 0.9em;
  padding-left: 6px;
  color: #939395;
}
.file-list.opened-files > ol.list-tree span.name {
  font-size: 1.025em;
}
.file-list.opened-files > ol.list-tree li.file {
  padding-left: 0;
}
.file-list.opened-files > ol.list-tree .file > span.icon-x {
  position: relative;
  width: 0px;
  left: -16px;
  top: 0px;
}
.file-list.opened-files > ol.list-tree .file > span.icon-x.notHovered {
  color: #e5e5e6;
}
.file-list.opened-files > ol.list-tree .file.selected > span.icon-x.notHovered {
  color: rgba(126, 127, 129, 0.16);
  text-shadow: none;
}
.file-list.opened-files > ol.list-tree .directory .icon-x {
  z-index: 10;
  margin-left: .5em;
}
.file-list.opened-files > ol.list-tree .file .icon-paintcan {
  margin-left: .5em;
}
